--------------------테이블 생성------------------
--------------------------------------------------
CREATE TABLE TBL_ATTENDANCE
(
    ID    NUMBER NOT NULL,
    START1  DATE  NOT NULL,
    END1    DATE,
    ATTENDANCE_HOUR    NUMBER,
    ATTENDANCE_OVERTIME    NUMBER,
    MEMBER_CODE    NUMBER NOT NULL,
    ATTENDANCE_DATE    VARCHAR2(255) NOT NULL,
    TITLE	  VARCHAR2(255)
);


CREATE TABLE TBL_AUTHORITY
(
    AUTHORITY_CODE    NUMBER NOT NULL,
    AUTHORITY_NAME    VARCHAR2(255) NOT NULL,
    AUTHORITY_DESC    VARCHAR2(255) NOT NULL
);


CREATE TABLE TBL_BOARD
(
    BOARD_NO    NUMBER NOT NULL,
    BOARD_TITLE    VARCHAR2(400) NOT NULL,
    BOARD_CONTENT    VARCHAR2(4000) NOT NULL,
    CREATED_DATE    VARCHAR2(500) NOT NULL,
    MODIFIED_DATE    VARCHAR2(500),
    MEMBER_CODE    NUMBER NOT NULL
);


CREATE TABLE TBL_BOARD_COMMENT
(
    COMMENT_NO    NUMBER NOT NULL,
    CREATED_DATE    VARCHAR2(500),
    MODIFIED_DATE    VARCHAR2(500),
    COMMENT_CONTENT    VARCHAR2(2000),
    MEMBER_CODE    NUMBER NOT NULL,
    BOARD_NO    NUMBER NOT NULL
);


CREATE TABLE TBL_FILE
(
    FILE_NO    NUMBER NOT NULL,
    BOARD_NO    NUMBER NOT NULL,
    FILE_NAME    VARCHAR2(255) NOT NULL
);


CREATE TABLE TBL_LEAVEAPP
(
    LEAVEAPP_NO    NUMBER NOT NULL,
    LEAVEAPP_DATE    VARCHAR2(255) NOT NULL,
    LEAVEAPP_TITLE    VARCHAR2(255) NOT NULL,
    LEAVEAPP_CONTENT    VARCHAR2(255) NOT NULL,
    LEAVEAPP_START    VARCHAR2(255) NOT NULL,
    LEAVEAPP_END    VARCHAR2(255) NOT NULL,
    LEAVEAPP_STATUS    CHAR DEFAULT 'N',
    REPORTLINE_DATE    VARCHAR2(255),
    LEAVEDOCUMENT_CAT    VARCHAR2(255) NOT NULL,
    MEMBER_CODE1    NUMBER,
    MEMBER_CODE2    NUMBER,
    MEMBER_CODE    NUMBER NOT NULL
);


CREATE TABLE TBL_MEMBER
(
    MEMBER_CODE    NUMBER NOT NULL,
    MEMBER_NAME    VARCHAR2(255) NOT NULL,
    MEMBER_BIRTH    VARCHAR2(255) NOT NULL,
    MEMBER_TEL    VARCHAR2(255) NOT NULL,
    MEMBER_ADDRESS    VARCHAR2(255) NOT NULL,
    MEMBER_JOIN    VARCHAR2(255),
    MEMBER_LEAVE    VARCHAR2(255),
    MEMBER_ENT    CHAR DEFAULT 'N',
    MEMBER_REMANET    NUMBER,
    MEMBER_GRADE    VARCHAR2(255) NOT NULL,
    MEMBER_DEP    VARCHAR2(255) NOT NULL,
    MEMBER_RT_PAYMENT    NUMBER,
    MEMBER_RT_STATUS    CHAR DEFAULT 'N',
    MEMBER_FILE    VARCHAR2(255),
    MEMBER_ID    VARCHAR2(255) NOT NULL,
    MEMBER_PW    VARCHAR2(255) NOT NULL,
    MEMBER_EMAIL    VARCHAR2(255) NOT NULL,
    MEMBER_BASIC_SALARY    VARCHAR2(255)
);


CREATE TABLE TBL_MEMBER_ROLE
(
    MEMBER_CODE    NUMBER NOT NULL,
    AUTHORITY_CODE    NUMBER NOT NULL
);


CREATE TABLE TBL_NOTICE
(
    NOTICE_NO    NUMBER NOT NULL,
    NOTICE_TITLE    VARCHAR2(400) NOT NULL,
    NOTICE_CONTENT    VARCHAR2(4000) NOT NULL,
    CREATED_DATE    VARCHAR2(500) NOT NULL,
    MODIFIED_DATE    VARCHAR2(500),
    MEMBER_CODE    NUMBER NOT NULL
);


CREATE TABLE TBL_SALARY
(
    SALARY_CODE    NUMBER NOT NULL,
    SALARY_OVERTIME    VARCHAR2(255),
    SALARY_BASIC    NUMBER,
    SALARY_MONTH    VARCHAR2(255),
    SALARY_YEAR    VARCHAR2(255),
    SALARY_BONUS    NUMBER,
    SALARY_STATUS    CHAR DEFAULT 'N',
    MEMBER_CODE    NUMBER NOT NULL,
    SALARY_REJECT_REASON VARCHAR2(255)
);
--------------------권한 설정--------------------
--------------------------------------------------
CREATE UNIQUE INDEX TBL_ATTENDANCE_PK ON TBL_ATTENDANCE
( ID );

ALTER TABLE TBL_ATTENDANCE
 ADD CONSTRAINT TBL_ATTENDANCE_PK PRIMARY KEY ( ID )
 USING INDEX TBL_ATTENDANCE_PK;



CREATE UNIQUE INDEX TBL_AUTHORITY_PK ON TBL_AUTHORITY
( AUTHORITY_CODE );

ALTER TABLE TBL_AUTHORITY
 ADD CONSTRAINT TBL_AUTHORITY_PK PRIMARY KEY ( AUTHORITY_CODE )
 USING INDEX TBL_AUTHORITY_PK;



CREATE UNIQUE INDEX TBL_BOARD_PK ON TBL_BOARD
( BOARD_NO );

ALTER TABLE TBL_BOARD
 ADD CONSTRAINT TBL_BOARD_PK PRIMARY KEY ( BOARD_NO )
 USING INDEX TBL_BOARD_PK;



CREATE UNIQUE INDEX TBL_BOARD_COMMENT_PK ON TBL_BOARD_COMMENT
( COMMENT_NO,BOARD_NO );

ALTER TABLE TBL_BOARD_COMMENT
 ADD CONSTRAINT TBL_BOARD_COMMENT_PK PRIMARY KEY ( COMMENT_NO,BOARD_NO )
 USING INDEX TBL_BOARD_COMMENT_PK;



CREATE UNIQUE INDEX TBL_FILE_PK ON TBL_FILE
( BOARD_NO,FILE_NO );

ALTER TABLE TBL_FILE
 ADD CONSTRAINT TBL_FILE_PK PRIMARY KEY ( BOARD_NO,FILE_NO )
 USING INDEX TBL_FILE_PK;



CREATE UNIQUE INDEX TBL_LEAVEAPP_PK ON TBL_LEAVEAPP
( LEAVEAPP_NO );

ALTER TABLE TBL_LEAVEAPP
 ADD CONSTRAINT TBL_LEAVEAPP_PK PRIMARY KEY ( LEAVEAPP_NO )
 USING INDEX TBL_LEAVEAPP_PK;



CREATE UNIQUE INDEX TBL_MEMBER_PK ON TBL_MEMBER
( MEMBER_CODE );

ALTER TABLE TBL_MEMBER
 ADD CONSTRAINT TBL_MEMBER_PK PRIMARY KEY ( MEMBER_CODE )
 USING INDEX TBL_MEMBER_PK;



CREATE UNIQUE INDEX TBL_MEMBER_ROLE_PK ON TBL_MEMBER_ROLE
( MEMBER_CODE,AUTHORITY_CODE );

ALTER TABLE TBL_MEMBER_ROLE
 ADD CONSTRAINT TBL_MEMBER_ROLE_PK PRIMARY KEY ( MEMBER_CODE,AUTHORITY_CODE )
 USING INDEX TBL_MEMBER_ROLE_PK;



CREATE UNIQUE INDEX TBL_NOTICE_PK ON TBL_NOTICE
( NOTICE_NO );

ALTER TABLE TBL_NOTICE
 ADD CONSTRAINT TBL_NOTICE_PK PRIMARY KEY ( NOTICE_NO )
 USING INDEX TBL_NOTICE_PK;



CREATE UNIQUE INDEX TBL_SALARY_PK ON TBL_SALARY
( SALARY_CODE );

ALTER TABLE TBL_SALARY
 ADD CONSTRAINT TBL_SALARY_PK PRIMARY KEY ( SALARY_CODE )
 USING INDEX TBL_SALARY_PK;

